import useFetch from '../../hooks/useFetch'
import Loading from '../Loading/Loading'
import './Profile.css'

function Profile() {
  const { status, value } = useFetch('https://127.0.0.1:3000/user')

  if (status === 'loading') {
    return (
      <aside id="profile">
        <Loading />
      </aside>
    )
  }
  return (
    <aside id="profile">
      "Hola, "{value.data.username}
    </aside>
  )
}

export default Profile
